import Productlist from './pages/productlist.jsx';
import Register from './pages/register.jsx';
import Singleproduct from './pages/singleproduct.jsx';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
}from "react-router-dom";



function App(){
    return(
        <Router>
            <Switch>
                 <Route path='/'>
                    <Home />
                 </Route>
            </Switch>
        </Router>

    )
}

export default App;
